          <img
            src={Login1}
            alt="resgister"
            style={{
              width: 460,
              position: "absolute",
              top: " 10%",
              left: 100,
            }}
          />
        </div>

        <div
          style={{
            position: "absolute",
            width: "50%",
            height: "-webkit-fill-available",
            left: "50%",
            background: "#FFF3CC",
          }}
        >
          {screen === "" ? (
            <>
              {Doc === "English" ? (
                <div>
                  <div
                    style={{
                      position: "fixed",
                      top: 20,
                      left: width * 0.59,
                      textAlign: "-webkit-center",
                      width: 500,
                      background: " #FFFFFF",
                      boxShadow: " 0px 4px 25px rgba(0, 0, 0, 0.15)",
                      borderRadius: 20,
                      padding: 30,
                    }}
